function SideVideo(props) {
  const handleVideoClick = () => {
    // Add your logic here, e.g., play the video, navigate, etc.
    console.log('Video clicked!');
  };

  return (
    <li className="side-video__section__item" onClick={handleVideoClick}>
      <section className="side-video__img-section">
        <img className="side-video__img" src={props.image} alt="Video thumbnail" />
      </section>
      <section className="side-video__description">
        <h5 className="side-video__title">{props.title}</h5>
        <p className="side-video__channel">{props.channel}</p>
      </section>
    </li>
  );
}
